INSERT INTO `news` VALUES ('92', '2022-02-08 08:43:24', '广西|昨日新增本土确诊病例64例', '2月7日0-24时，广西新增本土确诊病例64例（其中4例由无症状感染者转确诊病例）、本土无症状感染者2例。现有本土确诊病例108例，本土无症状感染者4例。\n当日新增境外输入确诊病例1例、境外输入无症状感染者7例。治愈出院境外输入确诊病例24例，解除医学观察境外输入无症状感染者4例。现有境外输入确诊病例97例，境外输入无症状感染者155例。\n当日新增密切接触者240人，解除医学观察密切接触者1人，现', '央视新闻app');
INSERT INTO `news` VALUES ('93', '2022-02-08 08:21:05', '四川|昨日新增境外确诊病例3例', '2月7日0—24时，四川新增新型冠状病毒肺炎确诊病例3例（均为境外输入，2例为2月4日无症状感染者转确诊，1例为2月6日无症状感染者转确诊），新增治愈出院病例2例，无新增疑似病例，无新增死亡病例。\n截至2月7日24时，四川全省累计报告新型冠状病毒肺炎确诊病例1380例（其中境外输入789例），累计治愈出院1357例，死亡3例，目前在院隔离治疗20例，280人尚在接受医学观察。\n2月7日0—24时，', '央视新闻app');
INSERT INTO `news` VALUES ('94', '2022-02-08 08:47:53', '天津市|昨日新增本土新冠肺炎确诊病例1例', '2022年2月7日0—24时，天津市新增1例本土新冠肺炎确诊病例。新增1例境外输入性新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院5人（均为本土病例）。\n自2022年1月8日至2月7日，天津市累计报告本土新冠肺炎确诊病例424例，治愈出院373人，在院51例。累计报告本土无症状感染者22例，解除医学观察6人，转为确诊病例16例。', '央视新闻app');
INSERT INTO `news` VALUES ('95', '2022-02-08 08:39:00', '河南|昨日新增境外无症状感染者转确诊病例1例', '记者从河南省卫健委了解到，2月7日0—24时，河南全省新增境外无症状感染者转确诊病例1例，无新增无症状感染者、疑似病例。49例本土确诊病例治愈出院。\n（总台记者田萌王一丹）', '央视新闻app');
INSERT INTO `news` VALUES ('96', '2022-02-08 09:07:00', '全国|昨日新增105例确诊病例，其中65例本土病例', '2月7日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例105例。其中境外输入病例40例（广东18例，上海15例，四川3例，北京1例，天津1例，河南1例，广西1例），含10例由无症状感染者转为确诊病例（广东5例，四川3例，北京1例，河南1例）；本土病例65例（广西64例，均在百色市；天津1例，在河北区），含4例由无症状感染者转为确诊病例（均在广西）。无新增死亡病例。无新增疑', '央视新闻app');
INSERT INTO `news` VALUES ('97', '2022-02-08 08:43:24', '广西|昨日新增本土确诊病例64例', '2月7日0-24时，广西新增本土确诊病例64例（其中4例由无症状感染者转确诊病例）、本土无症状感染者2例。现有本土确诊病例108例，本土无症状感染者4例。\n当日新增境外输入确诊病例1例、境外输入无症状感染者7例。治愈出院境外输入确诊病例24例，解除医学观察境外输入无症状感染者4例。现有境外输入确诊病例97例，境外输入无症状感染者155例。\n当日新增密切接触者240人，解除医学观察密切接触者1人，现', '央视新闻app');
INSERT INTO `news` VALUES ('98', '2022-02-08 08:21:05', '四川|昨日新增境外确诊病例3例', '2月7日0—24时，四川新增新型冠状病毒肺炎确诊病例3例（均为境外输入，2例为2月4日无症状感染者转确诊，1例为2月6日无症状感染者转确诊），新增治愈出院病例2例，无新增疑似病例，无新增死亡病例。\n截至2月7日24时，四川全省累计报告新型冠状病毒肺炎确诊病例1380例（其中境外输入789例），累计治愈出院1357例，死亡3例，目前在院隔离治疗20例，280人尚在接受医学观察。\n2月7日0—24时，', '央视新闻app');
INSERT INTO `news` VALUES ('99', '2022-02-08 08:47:53', '天津市|昨日新增本土新冠肺炎确诊病例1例', '2022年2月7日0—24时，天津市新增1例本土新冠肺炎确诊病例。新增1例境外输入性新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院5人（均为本土病例）。\n自2022年1月8日至2月7日，天津市累计报告本土新冠肺炎确诊病例424例，治愈出院373人，在院51例。累计报告本土无症状感染者22例，解除医学观察6人，转为确诊病例16例。', '央视新闻app');
INSERT INTO `news` VALUES ('100', '2022-02-08 08:39:00', '河南|昨日新增境外无症状感染者转确诊病例1例', '记者从河南省卫健委了解到，2月7日0—24时，河南全省新增境外无症状感染者转确诊病例1例，无新增无症状感染者、疑似病例。49例本土确诊病例治愈出院。\n（总台记者田萌王一丹）', '央视新闻app');
INSERT INTO `news` VALUES ('101', '2022-02-09 08:30:00', '全国|昨日新增确诊病例110例，其中本土确诊病例73例', '2月8日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例110例。其中境外输入病例37例（广东18例，上海9例，广西5例，福建2例，北京1例，天津1例，四川1例），含4例由无症状感染者转为确诊病例（北京1例，广东1例，广西1例，四川1例）；本土病例73例（广西72例，均在百色市；辽宁1例，在葫芦岛市），含2例由无症状感染者转为确诊病例（均在广西）。无新增死亡病例。无新增疑似病例。当日新增治愈出院病例88例，解除医学观察的密切接触者2975人，重症病例较前一日减少1例。境外输入现有确诊病例666例（其中重症病例1例），无现有疑似病例。累计确诊病例12825例，累计治愈出院病例12159例，无死亡病例。截至2月8日24时，据31个省（自治区、直辖市）和新疆生产建设兵团报告，现有确诊病例1495例（其中重症病例4例），累计治愈出院病例100503例，累计死亡病例4636例，累计报告确诊病例106634例，无现有疑似病例。累计追踪到密切接触者1548704人，尚在医学观察的密切接触者40980人。31个省（自治区、直辖市）和新疆生产建设兵团报告新增无症状感染者24例，其中境外输入23例，本土1例（在黑龙江黑河市）；当日转为确诊病例6例（境外输入4例）；当日解除医学观察53例（境外输入40例）；尚在医学观察的无症状感染者837例（境外输入745例）。累计收到港澳台地区通报确诊病例34494例。其中，香港特别行政区15176例（出院13315例，死亡213例），澳门特别行政区79例（出院79例），台湾地区19239例（出院13742例，死亡851例）。', '国家卫健委');
INSERT INTO `news` VALUES ('102', '2022-02-09 08:31:38', '广西|昨日新增72例本土确诊病例', '2月8日0—24时，广西新增本土确诊病例72例（其中2例由无症状感染者转确诊病例）。现有本土确诊病例180例，本土无症状感染者2例。\n当日新增境外输入确诊病例5例（其中1例由无症状感染者转确诊病例）、境外输入无症状感染者4例。治愈出院境外输入确诊病例6例。现有境外输入确诊病例96例，境外输入无症状感染者158例。\n当日新增密切接触者332人，解除医学观察密切接触者18人，现有密切接触者1129人。', '央视新闻app');
INSERT INTO `news` VALUES ('103', '2022-02-09 07:40:37', '上海|昨日新增9例境外确诊病例', '2022年2月8日0—24时，通过口岸联防联控机制，报告9例新增境外输入新冠肺炎确诊病例。新增治愈出院14例，其中来自美国3例，来自俄罗斯2例，来自英国2例，来自尼日利亚1例，来自加拿大1例，来自韩国1例，来自新加坡1例，来自多米尼加1例，来自科特迪瓦1例，来自芬兰1例。\n病例1为中国籍，在安哥拉工作，自安哥拉出发，经法国转机，于2022年1月28日抵达上海浦东国际机场，入关后即被集中隔离观察，其', '央视新闻app');
INSERT INTO `news` VALUES ('104', '2022-02-09 08:57:22', '天津|昨日新增1例境外确诊病例', '2022年2月8日0—24时，天津市无新增本土新冠肺炎确诊病例。新增1例境外输入性新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院10人（均为本土病例）。\n自2022年1月8日至2月8日，天津市累计报告本土新冠肺炎确诊病例424例，治愈出院383人，在院41例。累计报告本土无症状感染者22例，解除医学观察6人，转为确诊病例16例。\n（总台记者王烁贾立梁白紫冉）', '央视新闻app');
INSERT INTO `news` VALUES ('105', '2022-02-09 08:26:16', '四川|昨日新增1例境外确诊病例', '2月8日0—24时，四川新增新型冠状病毒肺炎确诊病例1例（境外输入，为2月7日无症状感染者转确诊），新增治愈出院病例1例，无新增疑似病例，无新增死亡病例。\n截至2月8日24时，全省累计报告新型冠状病毒肺炎确诊病例1381例（其中境外输入790例），累计治愈出院1358例，死亡3例，目前在院隔离治疗20例，296人尚在接受医学观察。\n2月8日0—24时，全省无新增无症状感染者，当日转为确诊病例1例，', '央视新闻app');
INSERT INTO `news` VALUES ('106', '2022-02-10 09:01:47', '全国|昨日新增29例确诊病例，其中7例本土病例', '2月9日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例29例。其中境外输入病例22例（广东9例，上海8例，吉林2例，浙江1例，福建1例，广西1例），含2例由无症状感染者转为确诊病例（广东1例，广西1例）；本土病例7例（均在广西百色市）。无新增死亡病例。新增疑似病例1例，为境外输入病例（在上海）。\n当日新增治愈出院病例96例，解除医学观察的密切接触者3263人，重症病例与前', '央视新闻app');
INSERT INTO `news` VALUES ('107', '2022-02-10 07:51:04', '上海|昨日新增8例境外确诊病例', '2022年2月9日0—24时，通过口岸联防联控机制，上海报告8例新增境外输入新冠肺炎确诊病例。新增治愈出院21例，其中来自美国5例，来自英国3例，来自俄罗斯3例，来自加拿大1例，来自芬兰1例，来自塞内加尔1例，来自斯里兰卡1例，来自塞尔维亚1例，来自日本1例，来自瑞士1例，来自尼日利亚1例，来自法国1例，来自德国1例。\n病例1为中国籍，在加拿大工作，自加拿大出发，于2022年2月4日抵达上海浦东国', '央视新闻app');
INSERT INTO `news` VALUES ('108', '2022-02-10 08:57:35', '吉林|昨日新增2例境外确诊病例', '　　2月9日0-24时，全省无新增本地确诊病例和无症状感染者。\n　　2月9日0-24时，全省新增境外输入确诊病例2例，为长春市报告。以上两人2月8日从韩国首尔机场乘坐OZ303航班抵达长春龙嘉机场，入境后即落实海关检疫、核酸检测、点对点转运、集中隔离医学观察等闭环管理措施，无省内自行活动轨迹。长春海关检测以上两人新冠病毒核酸阳性，经专家组会诊，均诊断为确诊病例（分别为普通型和轻型）。以上两人已由集中隔离点转送至定点医疗机构隔离诊治。其同航班人员均处于入境后的集中隔离医学观察期，均无省内自行活动轨迹。\n　　提醒广大公众，近期有疫情发生地区旅居史的人员，请立即主动向当地社区(村屯)或疾控机构报告，按要求配合做好相关疫情管控措施。如出现发热、咳嗽等急性呼吸道症状，请佩戴医用口罩及时到当地定点医疗机构发热门诊就诊。接种新冠疫苗是预防新冠肺炎的有效措施，请广大群众主动尽早接种，大家要树牢常态化防控意识，坚持外出戴口罩、勤洗手、常通风、保持社交距离、不聚餐、不聚集，减少疾病感染风险。', '吉林卫健委');
INSERT INTO `news` VALUES ('109', '2022-02-10 09:20:04', '浙江|昨日新增1例境外确诊病例', '记者从相关部门获悉，2月9日0—24时，浙江省新增新冠肺炎确诊病例1例（韩国输入），新增无症状感染者3例（其中加拿大输入1例，韩国输入1例，日本输入1例），已排查密切接触者均已实施集中隔离。截至9日24时，累计报告确诊病例2242例（境外输入病例375例）。\n（总台记者王依依吴文轩）', '央视新闻app');
INSERT INTO `news` VALUES ('110', '2022-02-10 09:12:46', '福建|昨日新增1例境外确诊病例', '一、境外输入疫情\n2月9日0—24时，福建省报告新增境外输入确诊病例1例（厦门市报告）。\n当日报告新增境外输入无症状感染者0例。\n截至2月9日24时，福建省累计报告境外输入确诊病例694例，目前住院34例，无死亡病例；现有报告境外输入疑似病例0例；现有报告境外输入无症状感染者尚在接受集中隔离医学观察29例。\n二、本地疫情\n2月9日0—24时，福建省无新增报告本土确诊病例、无症状感染者。\n自2021', '央视新闻app');
INSERT INTO `news` VALUES ('111', '2022-02-10 09:01:47', '全国|昨日新增29例确诊病例，其中7例本土病例', '2月9日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例29例。其中境外输入病例22例（广东9例，上海8例，吉林2例，浙江1例，福建1例，广西1例），含2例由无症状感染者转为确诊病例（广东1例，广西1例）；本土病例7例（均在广西百色市）。无新增死亡病例。新增疑似病例1例，为境外输入病例（在上海）。\n当日新增治愈出院病例96例，解除医学观察的密切接触者3263人，重症病例与前', '央视新闻app');
INSERT INTO `news` VALUES ('112', '2022-02-10 07:51:04', '上海|昨日新增8例境外确诊病例', '2022年2月9日0—24时，通过口岸联防联控机制，上海报告8例新增境外输入新冠肺炎确诊病例。新增治愈出院21例，其中来自美国5例，来自英国3例，来自俄罗斯3例，来自加拿大1例，来自芬兰1例，来自塞内加尔1例，来自斯里兰卡1例，来自塞尔维亚1例，来自日本1例，来自瑞士1例，来自尼日利亚1例，来自法国1例，来自德国1例。\n病例1为中国籍，在加拿大工作，自加拿大出发，于2022年2月4日抵达上海浦东国', '央视新闻app');
