INSERT INTO `news` VALUES ('114', '2022-02-10 09:20:04', '浙江|昨日新增1例境外确诊病例', '记者从相关部门获悉，2月9日0—24时，浙江省新增新冠肺炎确诊病例1例（韩国输入），新增无症状感染者3例（其中加拿大输入1例，韩国输入1例，日本输入1例），已排查密切接触者均已实施集中隔离。截至9日24时，累计报告确诊病例2242例（境外输入病例375例）。\n（总台记者王依依吴文轩）', '央视新闻app');
INSERT INTO `news` VALUES ('115', '2022-02-10 09:12:46', '福建|昨日新增1例境外确诊病例', '一、境外输入疫情\n2月9日0—24时，福建省报告新增境外输入确诊病例1例（厦门市报告）。\n当日报告新增境外输入无症状感染者0例。\n截至2月9日24时，福建省累计报告境外输入确诊病例694例，目前住院34例，无死亡病例；现有报告境外输入疑似病例0例；现有报告境外输入无症状感染者尚在接受集中隔离医学观察29例。\n二、本地疫情\n2月9日0—24时，福建省无新增报告本土确诊病例、无症状感染者。\n自2021', '央视新闻app');
INSERT INTO `news` VALUES ('116', '2022-02-14 09:07:54', '全国|昨日新增84例确诊病例，其中26例本土病例', '2月13日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例84例。其中境外输入病例58例（广东27例，山东14例，上海8例，福建5例，辽宁2例，河南1例，四川1例），含9例由无症状感染者转为确诊病例（广东5例，辽宁1例，福建1例，河南1例，四川1例）；本土病例26例（辽宁18例，均在葫芦岛市；广西6例，均在百色市；广东1例，在深圳市；云南1例，在文山壮族苗族自治州）。无新增', '央视新闻app');
INSERT INTO `news` VALUES ('117', '2022-02-14 08:08:15', '辽宁|昨日新增18例本土确诊病例', '2月13日0时至24时，辽宁省新增18例本土新冠肺炎确诊病例，为葫芦岛市报告；新增2例境外输入新冠肺炎确诊病例（其中1例由无症状感染者转为确诊病例），为大连市报告。无治愈出院病例。\n截至2月13日24时，辽宁省累计报告确诊病例878例（含境外输入177例），治愈出院809例，死亡2例，在院治疗67例（本土63例、境外输入4例）。目前，尚有10例（本土4例、境外输入6例）无症状感染者在定点医院隔离观', '央视新闻app');
INSERT INTO `news` VALUES ('118', '2022-02-14 08:17:09', '山东|昨日新增14例境外确诊病例', '2月13日0时至24时，山东省报告新增境外输入确诊病例14例，为俄罗斯输入（青岛14例）。新增境外输入无症状感染者2例，为斐济输入（威海2例）。无新增死亡病例，无新增疑似病例。\n当日无新增治愈出院确诊病例，解除医学观察的密切接触者22人。当日无解除医学观察无症状感染者，尚在医学观察的无症状感染者24例（其中境外输入23例，本土1例）。\n截至2022年2月13日24时，山东省报告现有确诊病例35例（', '央视新闻app');
INSERT INTO `news` VALUES ('119', '2022-02-14 07:46:05', '上海|昨日新增8例境外确诊病例', '2022年2月13日0—24时，上海通过口岸联防联控机制，报告8例新增境外输入性新冠肺炎确诊病例。新增治愈出院18例，其中来自俄罗斯4例，来自美国3例，来自英国2例，来自新加坡1例，来自圭亚那1例，来自牙买加1例，来自坦桑尼亚1例，来自加拿大1例，来自尼日利亚1例，来自法国1例，来自中国香港2例。\n病例1为中国籍，在黑山工作，自黑山出发，经奥地利转机，于2022年2月5日抵达上海浦东国际机场，入关', '央视新闻app');
INSERT INTO `news` VALUES ('120', '2022-02-14 08:35:44', '广西|昨日新增6例本土确诊病例', '2月13日0-24时，广西新增本土确诊病例6例（均为百色市）。截至2月13日24时，本轮广西疫情现有268例本土确诊病例（百色市267例，南宁市1例）。\n当日新增境外输入无症状感染者2例（均为崇左市）。治愈出院境外输入确诊病例3例（均为崇左市）。现有境外输入确诊病例93例（崇左市76例，钦州市12例，防城港市5例），境外输入无症状感染者155例（崇左市146例，钦州市8例，南宁市1例）。\n当日新增', '央视新闻app');
