INSERT INTO `news` VALUES ('129', '2022-02-14 12:32:39', '江苏|今日新增7例本土确诊病例', '今天（2月14日），苏州市召开疫情防控新闻发布会，介绍疫情防控最新情况。\n相关负责人介绍，截至2月14日上午11时，江苏苏州新增7例新冠肺炎确诊病例和1例无症状感染者。', '央视新闻app');
INSERT INTO `news` VALUES ('130', '2022-02-14 13:38:51', '辽宁|今日新增11例本土确诊病例', '2月14日0时—12时，辽宁省葫芦岛市新增11例新冠肺炎本土确诊病例，全部来自集中隔离的密切接触者中，现已转入定点医疗机构隔离治疗，病情稳定。现将病例主要行程轨迹公布如下：\n确诊病例62：男，家住绥中县加碑岩乡王家店村骆杖子屯木锹沟。2月8日在绥中县加碑岩乡王家店村路杖子屯木锹沟家中未外出。2月9日前往本村核酸采集点进行核酸检测。2月10日—12日在王家店家中无外出。2月13日转运至隔离点集中隔离', '央视新闻app');
