INSERT INTO `news` VALUES ('132', '2022-02-15 09:26:04', '江苏|昨日新增8例本土确诊病例', '江苏省卫健委2月15日通报：2月14日0—24时，江苏新增本土确诊病例8例（苏州市报告，在定点医院隔离治疗），新增本土无症状感染者4例（苏州市报告，在定点医院接受隔离医学观察）。新增境外输入确诊病例1例（新加坡输入，在连云港市定点医院隔离治疗），新增境外输入无症状感染者1例（日本输入，在无锡市定点医院接受隔离医学观察）。解除医学观察的无症状感染者1例（境外输入）。\n目前，在定点医院隔离治疗的确诊病', '央视新闻app');
INSERT INTO `news` VALUES ('133', '2022-02-15 07:56:53', '广东|昨日新增2例本土确诊病例', '2月14日0—24时，广东省新增本土确诊病例2例，深圳报告，均在纳入管控的密接排查中发现。\n广东省新增境外输入确诊病例16例（其中2例为无症状感染者转确诊），广州报告7例，2例来自斐济，其余5例分别来自老挝、越南、马来西亚、伊朗和埃塞俄比亚；深圳报告5例，均来自中国香港；东莞报告3例，均来自中国香港；江门报告1例，来自中国香港。新增境外输入无症状感染者15例，广州报告10例，3例来自菲律宾，2例来', '央视新闻app');
INSERT INTO `news` VALUES ('134', '2022-02-15 08:04:44', '辽宁|昨日新增29例本土确诊病例', '2月14日0时至12时，辽宁省新增11例本土新冠肺炎确诊病例，为葫芦岛市报告。无治愈出院病例。\n2月14日12时至24时，辽宁省新增18例本土新冠肺炎确诊病例，其中沈阳市报告1例（为无症状感染者转为确诊病例）、葫芦岛市报告17例；新增1例境外输入无症状感染者，为沈阳市报告。无治愈出院病例。\n截至2月14日24时，全省累计报告确诊病例907例（含境外输入177例），治愈出院809例，死亡2例，在院治疗96例(本土92例、境外输入4例)。目前，尚有10例（本土3例、境外输入7例）无症状感染者在定点医院隔离观察治疗。', '央视新闻app');
INSERT INTO `news` VALUES ('135', '2022-02-14 13:38:51', '辽宁|今日新增11例本土确诊病例', '2月14日0时—12时，辽宁省葫芦岛市新增11例新冠肺炎本土确诊病例，全部来自集中隔离的密切接触者中，现已转入定点医疗机构隔离治疗，病情稳定。现将病例主要行程轨迹公布如下：\n确诊病例62：男，家住绥中县加碑岩乡王家店村骆杖子屯木锹沟。2月8日在绥中县加碑岩乡王家店村路杖子屯木锹沟家中未外出。2月9日前往本村核酸采集点进行核酸检测。2月10日—12日在王家店家中无外出。2月13日转运至隔离点集中隔离', '央视新闻app');
INSERT INTO `news` VALUES ('136', '2022-02-16 08:58:00', '全国|昨日新增确诊病例102例，其中本土确诊病例46例', '2月15日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例102例。其中境外输入病例56例（广东24例，上海13例，福建6例，山东3例，云南3例，湖南2例，广西2例，天津1例，辽宁1例，四川1例），含10例由无症状感染者转为确诊病例（广东9例，四川1例）；本土病例46例（江苏19例，其中苏州市18例、南通市1例；辽宁15例，均在葫芦岛市；内蒙古7例，其中呼伦贝尔市5例、呼和', '央视新闻app');
INSERT INTO `news` VALUES ('137', '2022-02-16 09:13:42', '江苏|昨日新增19例本土确诊病例', '2月15日0—24时，江苏新增本土确诊病例19例（苏州市报告18例，南通市报告1例，均在定点医院隔离治疗），新增本土无症状感染者3例（苏州市报告1例，无锡市报告2例，均在定点医院接受隔离医学观察）。\n目前，在定点医院隔离治疗的确诊病例29例（本土27例，境外输入2例），接受医学观察的无症状感染者17例（本土8例，境外输入9例）。\n（总台记者&nbsp;吴睿）', '央视新闻app');
INSERT INTO `news` VALUES ('138', '2022-02-16 09:28:14', '内蒙古|昨日新增7例本土确诊病例', '根据内蒙古自治区卫健委官网消息，2月15日0—24时，内蒙古自治区报告无新增疑似病例和无症状感染者，新增本土确诊病例7例（呼和浩特市玉泉区1例、赛罕区1例，呼伦贝尔满洲里市5例）。新增本土确诊病例具体情况如下：\n确诊病例1、2：为同事关系，均为呼和浩特市2月15日通过主动就诊核酸检测阳性，经复核呈阳性，经专家组会诊，诊断为新冠肺炎确诊病例。\n确诊病例3、4：均为满洲里市2月15日通过主动就诊核酸检', '央视新闻app');
INSERT INTO `news` VALUES ('139', '2022-02-16 08:44:48', '广东|昨日新增3例本土确诊病例', '2月15日0—24时，广东省新增本土确诊病例3例，均为深圳报告，2例在纳入管控的密接排查中发现，1例在重点人员例行核酸检测中发现。新增本土无症状感染者1例，广州报告，在高风险岗位从业人员例行核酸检测中发现。\n广东省新增境外输入确诊病例24例（其中9例为无症状感染者转确诊），广州报告7例，2例来自中国香港，2例来自马来西亚，其余3例分别来自美国、俄罗斯和卢旺达；深圳报告8例，均来自中国香港；珠海报告', '央视新闻app');
INSERT INTO `news` VALUES ('140', '2022-02-16 08:35:53', '广西|昨日新增2例本土确诊病例', '2月15日0—24时，广西新增本土确诊病例2例（百色市）。截至2月15日24时，本轮广西疫情现有271例本土确诊病例（百色市270例，南宁市1例）。\n当日新增境外输入确诊病例2例（均为崇左市），境外输入无症状感染者3例（均为崇左市）。治愈出院境外输入确诊病例5例（均为崇左市），解除医学观察境外输入无症状感染者15例（崇左市14例，钦州市1例）。现有境外输入确诊病例94例（崇左市75例，钦州市12例', '央视新闻app');
INSERT INTO `news` VALUES ('141', '2022-02-17 08:57:18', '全国|昨日新增确诊病例92例，其中本土确诊病例35例', '2月16日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例92例。其中境外输入病例57例（广东22例，上海9例，山东9例，浙江4例，广西4例，福建3例，吉林2例，四川2例，河南1例，云南1例），含8例由无症状感染者转为确诊病例（广东4例，浙江1例，河南1例，广西1例，四川1例）；本土病例35例（江苏16例，均在苏州市；辽宁7例，均在葫芦岛市；广东7例，其中深圳市6例、广州市', '央视新闻app');
INSERT INTO `news` VALUES ('142', '2022-02-17 09:17:15', '江苏|昨日新增16例本土确诊病例', '2月16日0—24时，江苏新增本土确诊病例16例（均为苏州市报告，在定点医院隔离治疗），新增本土无症状感染者7例（苏州市报告6例，无锡市报告1例，均在定点医院接受隔离医学观察）。解除医学观察的无症状感染者2例（均为境外输入）。\n目前，在定点医院隔离治疗的确诊病例45例（本土43例，境外输入2例），接受医学观察的无症状感染者22例（本土15例，境外输入7例）。\n2020年1月22日至今，全省累计报告', '央视新闻app');
INSERT INTO `news` VALUES ('143', '2022-02-17 08:45:23', '广东|昨日新增7例本土确诊病例', '据“健康广东”通报，2月16日0—24时，广东省新增本土确诊病例7例，广州报告1例，在纳入管控的密接排查中发现；深圳报告6例，5例在纳入管控的密接排查中发现，1例为主动核酸检测发现。新增本土无症状感染者2例，深圳报告，均为密接排查发现。\n全省新增境外输入确诊病例22例（其中4例为无症状感染者转确诊），广州报告9例，3例来自新加坡，2例来自埃塞俄比亚，其余4例分别来自俄罗斯、澳大利亚、马来西亚和泰国', '央视新闻app');
INSERT INTO `news` VALUES ('144', '2022-02-17 08:04:24', '辽宁|昨日新增7例本土确诊病例', '2月16日0—24时，辽宁省新增7例本土新冠肺炎确诊病例，为葫芦岛市报告；新增1例境外输入无症状感染者，为大连市报告。无治愈出院病例。\n截至2月16日24时，辽宁省累计报告确诊病例930例（含境外输入178例），治愈出院809例，死亡2例，在院治疗119例（本土114例、境外输入5例）。目前，尚有11例（本土2例、境外输入9例）无症状感染者在定点医院隔离观察治疗。\n（总台记者李承泽）', '央视新闻app');
INSERT INTO `news` VALUES ('145', '2022-02-17 09:01:36', '内蒙古|昨日新增3例本土确诊病例', '2月16日0—24时，内蒙古自治区报告无新增疑似病例，新增本土确诊病例3例（呼和浩特市玉泉区1例、赛罕区1例、土左旗1例），新增境外输入无症状感染者1例（在通辽市科尔沁区）。新增本土确诊病例和境外输入无症状感染者具体情况如下：\n呼和浩特市确诊病例3：为病例1、2的密切接触者，通过对密接人员核酸检测呈阳性，经复核呈阳性，经专家组会诊，诊断为新冠肺炎确诊病例。\n呼和浩特市确诊病例4：通过主动就诊核酸检', '央视新闻app');
INSERT INTO `news` VALUES ('146', '2022-03-08 09:34:15', '国家卫健委：昨日新增本土确诊病例175例', '国家卫健委：昨日新增本土确诊病例175例', '央视新闻app');
INSERT INTO `news` VALUES ('147', '2022-03-08 07:52:33', '北京|昨日新增本土确诊病例1例', '3月7日0时至24时，北京新增1例本土确诊病例，无新增疑似病例和无症状感染者；新增21例境外输入确诊病例和17例无症状感染者，无新增疑似病例。治愈出院5例。\n本土确诊病例：现住海淀区双榆树西里。3月6日出现发热等症状，3月7日自行前往医院发热门诊就诊，当日核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型。\n境外输入确诊病例', '央视新闻app');
INSERT INTO `news` VALUES ('148', '2022-03-08 07:46:44', '上海|昨日新增本土确诊病例4例', '上海市卫健委今早（8日）通报：2022年3月7日0—24时，新增本土新冠肺炎确诊病例4例和无症状感染者51例，均在隔离管控中发现。新增境外输入性新冠肺炎确诊病例36例和无症状感染者10例，均在闭环管控中发现。\n2022年3月7日0—24时，通过口岸联防联控机制，报告36例新增境外输入性新冠肺炎确诊病例。新增治愈出院27例，其中来自中国香港16例，来自台湾地区4例，来自韩国2例，来自加拿大2例，来自', '央视新闻app');
INSERT INTO `news` VALUES ('149', '2022-03-08 08:04:12', '山东|昨日新增本土确诊病例31例', '2022年3月7日0时至24时，山东省报告新增确诊病例42例，分别为本土确诊病例31例（其中青岛29例，威海2例）和境外输入确诊病例11例（其中济南1例，由无症状感染者转归；青岛4例，分别为日本输入1例和韩国输入3例；烟台3例，为韩国输入；威海3例，为斐济输入）。无新增死亡病例。无新增疑似病例。\n当日新增治愈出院境外输入确诊病例1例（济南1例），解除医学观察的密切接触者34人。\n截至2022年3', '央视新闻app');
INSERT INTO `news` VALUES ('150', '2022-03-08 10:34:38', '江苏|昨日新增本土确诊病例10例', '江苏省卫健委3月8日通报：3月7日0—24时，江苏新增本土确诊病例10例（连云港市报告，均在定点医院隔离治疗），新增本土无症状感染者5例（连云港市4例，南通市1例，均在定点医院接受隔离医学观察），新增境外输入无症状感染者1例。新增出院病例6例（本土5例，境外输入1例），解除隔离医学观察的无症状感染者6例（均为本土）。\n目前，在定点医院隔离治疗的确诊病例86例（本土63例，境外输入23例），接受隔离', '央视新闻app');
INSERT INTO `news` VALUES ('151', '2022-03-16 09:08:47', '国家卫健委：昨日新增本土确诊病例1860例', '3月15日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例1952例。其中境外输入病例92例（广西24例，广东21例，山东11例，上海10例，四川9例，浙江5例，北京3例，天津2例，辽宁2例，福建2例，河南2例，云南1例），含20例由无症状感染者转为确诊病例（四川6例，浙江5例，广东4例，河南2例，广西2例，天津1例）；本土病例1860例（吉林1456例，其中长春市1044', '央视新闻app');
INSERT INTO `news` VALUES ('152', '2022-03-16 08:44:49', '广东|昨日新增59例本土确诊病例', '3月15日0-24时，广东省新增本土确诊病例59例（其中1例为无症状感染者转确诊），深圳报告55例，珠海报告1例，东莞报告1例，中山报告1例，韶关报告1例。新增本土无症状感染者54例，广州报告1例，深圳报告37例，东莞报告16例。\n广东新增境外输入确诊病例21例（其中4例为无症状感染者转确诊），广州报告2例，分别来自韩国和巴林；深圳报告14例，珠海报告4例，江门报告1例，均来自中国香港。新增境外输', '央视新闻app');
INSERT INTO `news` VALUES ('153', '2022-03-16 16:55:03', '重庆|今日新增本土确诊病例1例', '3月16日，重庆市公布江津区1例新冠肺炎确诊病例活动轨迹，具体如下：\n3月7日&nbsp;&nbsp;8:30左右从家（鼎山街道美天公园王府小区6栋）自驾前往新雅幼儿园（鼎山街道长风路619号）并在门口摊铺买早点，后自驾前往区中心医院，11:50左右自驾返家，12:54前往梦萱超市（美天公园王府17栋6-6号）取快递，14:30左右自驾前往区中心医院，17:40自驾前往新雅幼儿园，18:00左右回', '央视新闻app');
INSERT INTO `news` VALUES ('154', '2022-03-16 15:12:54', '上海|新增两个中风险地区', '16日，记者从上海市召开新冠肺炎疫情防控新闻发布会上获悉，根据国务院联防联控机制有关要求和今天已经公布的确诊病例等相关情况，经上海市新冠肺炎疫情防控工作领导小组办公室研究决定，即日起将上海市浦东新区惠南镇听悦路920号、上海市闵行区江川路街道剑川路综合服务中心工地宿舍列为中风险地区，相关地区已落实管控措施。\n（总台记者王殿甲杨静成奕霖）', '央视新闻app');
INSERT INTO `news` VALUES ('155', '2022-03-16 16:57:26', '北京|新增1地中风险地区', '\n截至2022年3月16日12时，朝阳区小红门乡肖村近14天累计报告3例本土确诊病例。经市疾控中心评估，按照《北京市新冠肺炎疫情风险分级标准》，本市即日起将朝阳区小红门乡肖村定为中风险地区。截至目前，北京市共有中风险地区1个，为朝阳区小红门乡肖村。全市其它地区均为低风险地区。\n\n', '北京卫健委');
INSERT INTO `news` VALUES ('156', '2022-03-22 09:47:00', '国家卫健委：昨日新增本土确诊病例2281例', '3月21日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例2338例。其中境外输入病例57例（广东12例，浙江10例，广西9例，上海8例，四川6例，福建5例，北京4例，天津1例，辽宁1例，黑龙江1例），含17例由无症状感染者转为确诊病例（浙江9例，四川6例，天津1例，广东1例）；本土病例2281例（吉林1902例，其中长春市1437例、吉林市438例、四平市23例、延边朝鲜', '央视新闻app');
INSERT INTO `news` VALUES ('157', '2022-03-22 09:12:59', '吉林|昨日新增1902例本土确诊病例', '3月21日0-24时，吉林全省新增本地确诊病例1902例（轻型1891例、普通型10例、重型1例），其中长春市1437例（含2例无症状感染者转为确诊病例）、吉林市438例（含31例无症状感染者转为确诊病例）、四平市23例、延边州4例。\n新增本地无症状感染者563例，其中吉林市558例、延边州3例、四平市1例、辽源市1例。以上感染者均已转运至定点医疗机构隔离治疗，对以上人员的密切接触者、次密切接触者', '央视新闻app');
INSERT INTO `news` VALUES ('158', '2022-03-22 08:05:39', '辽宁|昨日新增67例本土确诊病例', '3月21日0—24时，辽宁省新增67例本土新冠肺炎确诊病例，其中沈阳市报告7例、大连市报告5例（含4例由无症状感染者转为确诊病例）、营口市报告55例；新增183例本土无症状感染者，其中沈阳市报告40例、大连市报告41例、营口市报告102例；新增1例境外输入新冠肺炎确诊病例和8例境外输入无症状感染者，均为沈阳市报告。治愈出院本土新冠肺炎确诊病例1例、境外输入新冠肺炎确诊病例2例、境外输入无症状感染者', '央视新闻app');
INSERT INTO `news` VALUES ('159', '2022-03-22 08:05:03', '黑龙江|昨日新增43例本土确诊病例', '2022年3月21日0-24时，黑龙江省新增新冠肺炎境外输入确诊病例1例（哈尔滨市报告，韩国输入）；新增本土确诊病例42例（均在哈尔滨市，其中五常市34例、尚志市7例、双城区1例），本土无症状感染者转确诊病例1例（五常市1例），新增本土无症状感染者13例（均在哈尔滨市，其中五常市11例、尚志市2例），新增阳性感染者均为隔离管控筛查发现。当日解除医学观察境外输入无症状感染者1例；治愈出院本土确诊病例', '央视新闻app');
INSERT INTO `news` VALUES ('160', '2022-03-22 08:48:14', '广东|昨日新增25例本土确诊病例', '3月21日0-24时，广东全省新增本土确诊病例25例（其中2例为无症状感染者转确诊），深圳报告23例，中山报告2例。新增本土无症状感染者5例，均为深圳报告。\n广东全省新增境外输入确诊病例12例（其中1例为无症状感染者转确诊），广州报告8例，6例来自印度尼西亚，2例来自尼日利亚；佛山报告1例，来自塔吉克斯坦；深圳报告1例，珠海报告2例，均来自中国香港。新增境外输入无症状感染者39例，广州报告5例，2', '央视新闻app');
INSERT INTO `news` VALUES ('161', '2022-04-06 08:57:42', '国家卫健委|昨日新增本土确诊病例1383例', '4月5日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例1415例。其中境外输入病例32例（四川14例，广东5例，上海4例，广西4例，天津1例，福建1例，山东1例，重庆1例，云南1例），含17例由无症状感染者转为确诊病例（四川13例，广西2例，广东1例，云南1例）；本土病例1383例（吉林973例，其中长春市817例、吉林市136例、白城市11例、四平市5例、白山市4例；上', '央视新闻app');
INSERT INTO `news` VALUES ('162', '2022-04-06 09:42:00', '吉林|昨日新增本土确诊病例973例', '\n　　4月5日0-24时，全省新增本地确诊病例973例(轻型938例、普通型26例、重症9例），其中长春市817例（含51例无症状感染者转为确诊病例）、吉林市136例（含10例无症状感染者转为确诊病例）、白城市11例（含4例无症状感染者转为确诊病例）、四平市5例、白山市4例；新增本地无症状感染者1798例，其中长春市1682例、吉林市112例、四平市2例、白城市2例。以上感染者均已转运至定点医疗机构隔离治疗，对以上人员的密切接触者、次密切接触者均已开展追踪排查，并落实管控措施，对其生活和工作场所进行了终末消毒。\n　　4月5日0-24时，全省新增治愈出院确诊病例1531例，其中长春市1112例、吉林市418例、延边州1例；新增解除隔离医学观察无症状感染者658例，其中长春市336例、吉林市322例。\n　　提醒广大公众，要密切关注各地发布的疫情动态信息，如与阳性感染者活动轨迹有交集，或近期有疫情发生地区旅居史，请立即主动向当地社区(村屯)或疾控机构报告，按要求配合做好相关疫情管控措施。如出现发热、咳嗽等急性呼吸道症状，请佩戴医用口罩及时到当地定点医疗机构发热门诊就诊。大家要树牢常态化防控意识，坚持外出戴口罩、勤洗手、常通风、保持社交距离、不聚餐、不聚集，减少疾病感染风险。\n', '吉林卫健委');
INSERT INTO `news` VALUES ('163', '2022-04-06 07:46:25', '上海|昨日新增本土确诊病例311例', '上海市卫健委今早（6日）通报：2022年4月5日0—24时，新增本土新冠肺炎确诊病例311例和无症状感染者16766例，其中40例确诊病例为此前无症状感染者转归，4例确诊病例和16256例无症状感染者在隔离管控中发现，其余在相关风险人群排查中发现。新增境外输入新冠肺炎确诊病例4例和无症状感染者1例，均在闭环管控中发现。\n（总台记者王殿甲杨静）', '央视新闻app');
INSERT INTO `news` VALUES ('164', '2022-04-06 08:00:00', '辽宁|昨日新增本土确诊病例7例', '\n4月5日0-24时，辽宁省新增7例本土新冠肺炎确诊病例，为鞍山市报告（含1例由无症状感染者转为确诊病例）；新增43例本土无症状感染者，其中沈阳市报告30例（含1例外省关联病例）、鞍山市报告12例、锦州市报告1例；新增境外输入无症状感染者1例，为大连市报告。治愈出院本土新冠肺炎确诊病例38例、本土无症状感染者147例、境外输入无症状感染者4例。\n截至4月5日24时，全省累计报告确诊病例1599例（含境外输入208例），治愈出院1391例，死亡2例，在院治疗206例(本土205例、境外输入1例)。目前，尚有1200例（本土1151例、境外输入49例）无症状感染者在定点医院隔离观察治疗。\n\n\n\n\n\n\n\n\n\n', '辽宁卫健委');
INSERT INTO `news` VALUES ('165', '2022-04-06 08:10:58', '河北|昨日新增本土确诊病例6例', '4月5日0—24时，河北省新增本土新型冠状病毒肺炎确诊病例6例，其中邯郸市5例、雄安新区1例（外省关联病例）；新增本土无症状感染者103例，其中邯郸市78例、保定市21例、石家庄市4例（外地返回人员）。治愈出院14例，无症状感染者解除医学观察134例。\n截至4月5日24时，河北省现有本土确诊病例157例；尚在医学观察本土无症状感染者1941例。（总台记者谢宾超谷俊雄）', '央视新闻app');
INSERT INTO `news` VALUES ('166', '2022-04-10 08:59:52', '国家卫健委|昨日新增本土确诊病例1318例', '4月9日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例1351例。其中境外输入病例33例（上海9例，广东7例，广西5例，四川4例，福建3例，北京1例，天津1例，辽宁1例，山东1例，云南1例），含1例由无症状感染者转为确诊病例（在广东）；本土病例1318例（上海1006例，其中浦东新区513例、黄浦区103例、闵行区86例、金山区45例、徐汇区43例、宝山区35例、杨浦区3', '央视新闻app');
INSERT INTO `news` VALUES ('167', '2022-04-10 09:02:06', '吉林|昨日新增本土确诊病例242例', '4月9日0—24时，吉林省新增本土确诊病例242例（轻型232例、普通型9例、重症1例），其中长春市175例（含90例无症状感染者转为确诊病例）、吉林市65例、白城市2例；新增本土无症状感染者755例，其中长春市703例、吉林市50例、白城市2例。以上感染者均已转运至定点医疗机构隔离治疗，对以上人员的密切接触者、次密切接触者均已开展追踪排查，并落实管控措施，对其生活和工作场所进行了终末消毒。\n4月', '央视新闻app');
INSERT INTO `news` VALUES ('168', '2022-04-10 09:07:31', '浙江|昨日新增本土确诊病例16例', '4月9日0—24时，浙江省11个市报告新增确诊病例16例。其中无境外输入病例；本土病例16例（杭州市7例，宁波市3例，嘉兴市5例，丽水市1例），含10例由无症状感染者转为确诊病例（杭州市7例，嘉兴市3例）。\n当日新增治愈出院病例2例，解除医学观察的密切接触者1065人。\n11个市报告新增无症状感染者34例。其中境外输入2例（中国香港输入1例，日本输入1例）；本土32例（杭州市10例，嘉兴市19例，', '央视新闻app');
INSERT INTO `news` VALUES ('169', '2022-04-10 08:43:23', '广东|昨日新增本土确诊病例10例', '4月9日0—24时，广东省新增本土确诊病例10例（其中1例为无症状感染者转确诊），均为广州报告；新增本土无症状感染者13例，广州报告1例，深圳报告4例，佛山报告8例。全省新增出院19例（境外输入8例），目前在院157例（境外输入55例）；新增解除医学观察无症状感染者39例（境外输入24例），尚在医学观察无症状感染者550例（境外输入361例）。\n全省新增境外输入确诊病例7例（其中1例为无症状感染者', '央视新闻app');
INSERT INTO `news` VALUES ('170', '2022-04-10 09:34:26', '陕西|昨日新增本土确诊病例2例', '4月9日0—24时，新增报告本土确诊病例2例（均在西安），出院1例。\n截至4月9日24时，现有在院隔离治疗35例、隔离医学观察3例。\n本土确诊病例1，男，34岁，西安市报告。4月7日从外省自驾返回西安，集中隔离期间核酸检测结果阳性，4月9日经市级专家组诊断为新冠肺炎确诊病例（轻型）。\n本土确诊病例2，男，34岁，西安市报告。4月8日在封控区筛查中核酸检测结果异常，随后被集中隔离。4月9日核酸检测结', '央视新闻app');
